import ExpenseItem from "./components/ExpenseItem";

function App() {  
  const expenses = [
    {
      title: "car Insurance",
      amout: 379,
      date:  new Date(2021, 2, 28).toDateString(),
    },
     {
      title: "apple laptop",
      amout: 10000.500,
      date: new Date(2022, 3, 1).toDateString(),
    },
    {
      title: "apple laptop",
      amout: 10000.500,
      date: new Date(2022, 3, 1).toDateString(),
    },
  ];


  return (
    <div>
      <h2>Let's get started!</h2>
      {expenses.map((item) => (
        <ExpenseItem title={item.title} date={item.date} amount={item.amout} />
      ))}
    </div>
  );
}

export default App;
